    return (
        <div id="timeline">
        <p> test
        </p>
        <Timeline>
          <Events>
          {result ? result.map(d =>
            <ImageEvent
            date={d ? d.date : 'loading'}
            text={d ?d.text : 'loading'}
            src={d ?d.src : 'loading'}
            credit={d ?d.textBelow : 'loading'}
